import React from 'react';
import { Card } from 'react-bootstrap';

function CurrentWeather(props) {
  // console.log(weather)
  // const { weather } = props.weather;

  if (!props.weather) {
    return 'Loading...'
  }

  return (
    <Card>
        <Card.Body>
          {props.weather.icon}
          {props.weather.main}
          {props.weather.description}
        </Card.Body>
    </Card>
  );
}

export default CurrentWeather;
